CREATE INDEX  idx_ord_Esposizione
ON Specie(esposizione);


CREATE INDEX  idx_ord_EsposizioneSpecifica
ON Piante(esposizioneSpecifica);

CREATE INDEX  idx_ord_DataMessaDimora
ON Piante(data);

CLUSTER Piante USING idx_ord_DataMessaDimora;

DROP INDEX idx_ord_CM;
DROP INDEX idx_ord_scuolaClasse;

CREATE INDEX  idx_ord_CM
ON Scuole(CM);

CREATE INDEX  idx_ord_scuolaClasse
ON Classi(scuola);

ANALYZE;


-------------------------------------------------------------------------------------------------------------------
---------------------------------------------------CONTROLLO DELL' ACCESSO------------------------------------------
-------------------------------------------------------------------------------------------------------------------

--Creazione ruoli 
CREATE ROLE AdminProgetto;
CREATE ROLE AdminIstituto;
CREATE ROLE AdminScuola;
CREATE ROLE Insegnante;
CREATE ROLE Studente;

--Definizione gerarchie ruoli 
GRANT Studente TO Insegnante;
GRANT Insegnante TO AdminScuola;
GRANT AdminScuola TO AdminIstituto;
GRANT AdminIstituto TO AdminProgetto WITH ADMIN OPTION;

--Creazione utenti 
CREATE USER BimboProdigio PASSWORD  'YuGiOh';
CREATE USER ProfSimpatico PASSWORD  'Alessandro';
CREATE USER GuerriniGiovanna PASSWORD 'BasiDati';
CREATE USER CataniaBarbara PASSWORD 'Informatica';
CREATE USER BoyceRaimondo PASSWORD 'BCNF';

--Assegnazione ruoli agli utenti
GRANT Studente TO BimboProdigio; 
GRANT Insegnante TO ProfSimpatico; 
GRANT AdminScuola TO GuerriniGiovanna; 
GRANT AdminIstituto TO CataniaBarbara; 
GRANT AdminProgetto TO BoyceRaimondo; 



--Lo studente potrà inserire, modificare e visionare rilevazioni, e visionare le piante
--potrà anche delegare i permessi ricevuti ad altri studenti
GRANT INSERT, UPDATE
ON danniFoglia, Rilevazioni
TO Studente;

GRANT SELECT
ON danniFoglia, Rilevazioni, Piante
TO Studente
WITH GRANT OPTION;


--Il docente potrà gestire autonomamente tutte le attività del progetto
--potrà anche delegare i permessi ricevuti ad altri docenti
GRANT INSERT, UPDATE
ON Sensori, Piante
TO Insegnante
WITH GRANT OPTION;

GRANT DELETE
ON danniFoglia, Rilevazioni, Sensori, Piante
TO Insegnante
WITH GRANT OPTION;

GRANT SELECT
ON Gruppi, Orti, Sensori, Specie
TO Insegnante
WITH GRANT OPTION;

--Il referente della scuola gestisce le classi e le persone della relativa scuola
GRANT INSERT, UPDATE
ON Classi, Persone
TO AdminScuola;

GRANT DELETE
ON Classi, Persone
TO AdminScuola;

GRANT SELECT
ON Classi, Persone
TO AdminScuola;

--Il referente di istituto gestisce a i gruppi e gli orti presenti nell'istituto,
--può anche visionare i differenti istituti che hanno aderito o stanno partecipando al progetto
GRANT INSERT, UPDATE
ON Orti, Gruppi
TO AdminIstituto;

GRANT DELETE
ON Orti, Gruppi
TO AdminIstituto;

GRANT SELECT
ON Scuole
TO AdminIstituto;

--Il gestore del progetto gestirà gli istituti partecipanti e le specie scelte per il progetto stesso
--con la possibilità di delegare i suoi permessi a piacimento per eventuali necessità
GRANT INSERT, UPDATE
ON Specie, Scuole
TO AdminProgetto
WITH GRANT OPTION;

GRANT DELETE
ON Specie, Scuole
TO AdminProgetto
WITH GRANT OPTION;


